import React, {useState, useEffect} from 'react';

const axios = require('axios');

export const History = () => {
    const [data,setData]=useState([]);

    /* construct url queries */
    const url = 'http://localhost:3001/fires?Counties=';
    const arr = ["Sonoma", "Butte", "Napa"];
    const queries = arr.map(county => axios.get(url+county));
    let temp = [];

    /* set state data */
    const getData = () => {
        axios.all(queries)
        .then(resArr => {
            temp = resArr.map(resArr => resArr.data);
            setData(temp)
        });
    };

    useEffect(()=>{
        getData();
    },[])

    console.log(data);

    return(
        <>
        <section class="col-md-12 col-sm-12 col-xs-12" style="background-color: #45B8CF; z-index: 1;" id="challenges">
		    <div id="carouselExampleIndicators" class="carousel slide text-center" data-ride="carousel">
                <ol class="carousel-indicators">
                    <li data-target="#carouselExampleIndicators" data-slide-to="0" class="active"></li>
                </ol>
                <div class="challenges carousel-inner w-75">
                    <div class="carousel-item active">
                    </div>
                </div>
            </div>
		</section>
        </>
    );
};
